import React from 'react';
import {Link} from 'react-router-dom';

import {Box, ListItemIcon, ListItemButton, Grid} from '@mui/material';

const NavItem = (tag) => {
    return (
        <Link to='#' color={tag.color}>
            {tag.title}
        </Link>
    );
}

export default NavItem;
